// Import Link from react-router-dom
import React from 'react';
import { Link } from 'react-router-dom';
import styles from './Sidebar.module.css'; // Assuming you have a CSS module for styling
import Button from '/ui/Button'; // Import the updated Button component

const Sidebar = () => {
    return (
        <aside className={styles.sidebar}>
            <Button path="/">Home</Button>
            <Button path="/about">About</Button>
            <Button path="/settings">Settings</Button>
            {/* Add other navigation links as needed */}
        </aside>
    );
};

export default Sidebar;
